import React,{createRef} from 'react';
const Search=props=>{
    let nameRef=createRef();
    const put=()=>{
        let name=nameRef.current.value;
        props.add(name);

    }
    return(
        <div id="search">
            
            <input type="text" ref={nameRef} />
            <button onClick={put}>Put</button>
        </div>
    )
}
export default Search;
